import React from "react";

export default function About() {
  return (
    <section className="max-w-4xl mx-auto mb-10 p-6 bg-white rounded-xl shadow-md">
      <h2 className="text-3xl font-semibold border-b pb-2 mb-4 text-purple-600">About Me</h2>
      <p className="text-gray-700 leading-relaxed">
        A proactive and enthusiastic final-year IT student with a solid academic foundation and hands-on
        experience in technology and programming. Seeking opportunities to apply my skills, contribute to innovative
        projects, and gain industry exposure while continuing to learn and grow in a dynamic environment.
      </p>
    </section>
  );
}
